    return (
        <section className={props.card === "" ? `popup popup_type_image` : `popup popup_type_image popup_opened`}>
            <div className="popup__image-box">
                <img src={props.card} alt="изображение" className="popup__image" />
                <h2 className="popup__image-title">Челябинская область</h2>
                <button className="popup__close-button popup__close-button_type_image" type="button"></button>
            </div>
        </section>
    );
  }

